{"items": [{"UnitType": 9, "UnitTypeDesc": "Film", "Header": {"He": "\u05d1\u05d3\u05d9\u05e7\u05d43", "En": "TESTING3"}, "UnitText1": {"He": "\u05e1\u05e8\u05d8 \u05d0\u05e8\u05db\u05d9\u05d5\u05e0\u05d9 \u05d4\u05de\u05ea\u05d0\u05e8 \u05d9\u05de\u05d9\u05dd \u05e9\u05dc \u05d7\u05d5\u05e4\u05e9 \u05d5\u05d1\u05d9\u05dc\u05d5\u05d9\u05d9 \u05e4\u05e0\u05d0\u05d9 \u05e9\u05dc \u05de\u05e9\u05e4\u05d7\u05d4 \u05d9\u05d4\u05d5\u05d3\u05d9\u05ea \u05d1\u05d5\u05e8\u05d2\u05e0\u05d9\u05ea \u05de\u05d1\u05e8\u05e0\u05d5, \u05e6'\u05db\u05d5\u05e1\u05dc\u05d5\u05d1\u05e7\u05d9\u05d4 \u05e2\u05e8\u05d1 \u05d1\u05e9\u05e0\u05d9\u05dd \u05e9\u05dc\u05e4\u05e0\u05d9 \u05de\u05dc\u05d7\u05de\u05ea \u05d4\u05e2\u05d5\u05dc\u05dd \u05d4\u05e9\u05e0\u05d9\u05d9\u05d4, \u05dc\u05e4\u05e0\u05d9 \u05d4\u05e9\u05d5\u05d0\u05d4. \u05d4\u05e1\u05e8\u05d8 \u05e6\u05d5\u05dc\u05dd \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d0\u05d3\u05d5\u05d0\u05e8\u05d3 \u05dc\u05e7\u05e1 \u05e9\u05ea\u05d9\u05e2\u05d3 \u05d0\u05ea \u05de\u05e9\u05e4\u05d7\u05ea\u05d5. \u05d4\u05e1\u05e8\u05d8 \u05e6\u05d5\u05dc\u05dd \u05d1\u05de\u05e6\u05dc\u05de\u05ea 8 \u05de\"\u05de \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d0\u05d1\u05d9 \u05d4\u05de\u05e9\u05e4\u05d7\u05d4, \u05d0\u05d3\u05d5\u05d0\u05e8\u05d3 \u05dc\u05e7\u05e1 \u05d0\u05e9\u05e8 \u05d4\u05d5\u05d0 \u05e2\u05e6\u05de\u05d5 \u05e9\u05e8\u05d3 \u05d0\u05ea \u05d4\u05e9\u05d5\u05d0\u05d4, \u05d0\u05da \u05d0\u05e9\u05ea\u05d5 \u05d5\u05d9\u05dc\u05d3\u05d9\u05d5 \u05d4\u05e0\u05e8\u05d0\u05d9\u05dd \u05d1\u05e1\u05e8\u05d8 \u05e0\u05e1\u05e4\u05d5.\n\u05d4\u05e1\u05e8\u05d8 \u05e0\u05e2\u05e8\u05da \u05d5\u05d4\u05d5\u05e1\u05e3 \u05dc\u05d5 \u05e4\u05e1 \u05e7\u05d5\u05dc \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d1\u05d9\u05ea \u05d4\u05ea\u05e4\u05d5\u05e6\u05d5\u05ea \u05d1 -2008\n\n\u05d4\u05e1\u05e8\u05d8  \u05e0\u05de\u05e1\u05e8 \u05dc\u05d1\u05d9\u05ea \u05d4\u05ea\u05e4\u05d5\u05e6\u05d5\u05ea \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d2\u05d1' \u05d7\u05d5\u05d5\u05d4 \u05db\u05d4\u05df, \u05d1\u05ea\u05d5 \u05d4\u05d7\u05d5\u05e8\u05d2\u05ea \u05e9\u05dc \u05d0\u05d3\u05d5\u05d0\u05e8\u05d3 \u05dc\u05e7\u05e1.", "En": "A film based on archival footage depicting a Jewish bourgeois family and friends from Brno, Czechoslovakia, enjoying themselves on vacation and in other leisure activities. The original footage was shot by Eduard Lax who documented his family and friends, an upper middle class family, spending leisure time together. The film was shot with a 8mm film camera by the father, Eduard Lax who survived the Holocaust while his wife and children that appear, perished. The original silent film was edited and a soundtrack was added by Beth Hatefutsoth in 2008.\n\nThe film was presented to the museum, by Chava Cohen, stepdaughter of Eduard Lax.\n"}, "Slug": {"He": "\u05d5\u05d9\u05d3\u05d0\u05d5_\u05d9\u05de\u05d9\u05dd-\u05d9\u05e4\u05d9\u05dd-\u05d1\u05d1\u05e8\u05e0\u05d5-\u05e6\u05db\u05d5\u05e1\u05dc\u05d5\u05d1\u05e7\u05d9\u05d4-1935-\u05d0\u05e0\u05d2\u05dc\u05d9\u05ea", "En": "video_happy-days-in-brno-czechoslovakia-1935-english"}, "video_url": "https://storage.googleapis.com/bhs-movies/1339ba7a-68f5-4cd8-b525-67295ffe308b.mp4", "main_image_url": "https://storage.googleapis.com/bhs-flat-pics/2A399509-EFA8-4AB1-8847-6A07978F0386.jpg", "preview_image_url": "https://storage.googleapis.com/bhs-flat-pics/2A399509-EFA8-4AB1-8847-6A07978F0386.jpg", "image_urls": ["https://storage.googleapis.com/bhs-flat-pics/2A399509-EFA8-4AB1-8847-6A07978F0386.jpg"], "item_url_he": null, "item_url_en": null}, {"UnitType": 9, "UnitTypeDesc": "Film", "Header": {"He": "\u05d1\u05d3\u05d9\u05e7\u05d44", "En": "TESTING4"}, "UnitText1": {"He": "\u05e1\u05e8\u05d8 \u05d0\u05e8\u05db\u05d9\u05d5\u05e0\u05d9 \u05d4\u05de\u05ea\u05d0\u05e8 \u05d9\u05de\u05d9\u05dd \u05e9\u05dc \u05d7\u05d5\u05e4\u05e9 \u05d5\u05d1\u05d9\u05dc\u05d5\u05d9\u05d9 \u05e4\u05e0\u05d0\u05d9 \u05e9\u05dc \u05de\u05e9\u05e4\u05d7\u05d4 \u05d9\u05d4\u05d5\u05d3\u05d9\u05ea \u05d1\u05d5\u05e8\u05d2\u05e0\u05d9\u05ea \u05de\u05d1\u05e8\u05e0\u05d5, \u05e6'\u05db\u05d5\u05e1\u05dc\u05d5\u05d1\u05e7\u05d9\u05d4 \u05e2\u05e8\u05d1 \u05d1\u05e9\u05e0\u05d9\u05dd \u05e9\u05dc\u05e4\u05e0\u05d9 \u05de\u05dc\u05d7\u05de\u05ea \u05d4\u05e2\u05d5\u05dc\u05dd \u05d4\u05e9\u05e0\u05d9\u05d9\u05d4, \u05dc\u05e4\u05e0\u05d9 \u05d4\u05e9\u05d5\u05d0\u05d4. \u05d4\u05e1\u05e8\u05d8 \u05e6\u05d5\u05dc\u05dd \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d0\u05d3\u05d5\u05d0\u05e8\u05d3 \u05dc\u05e7\u05e1 \u05e9\u05ea\u05d9\u05e2\u05d3 \u05d0\u05ea \u05de\u05e9\u05e4\u05d7\u05ea\u05d5. \u05d4\u05e1\u05e8\u05d8 \u05e6\u05d5\u05dc\u05dd \u05d1\u05de\u05e6\u05dc\u05de\u05ea 8 \u05de\"\u05de \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d0\u05d1\u05d9 \u05d4\u05de\u05e9\u05e4\u05d7\u05d4, \u05d0\u05d3\u05d5\u05d0\u05e8\u05d3 \u05dc\u05e7\u05e1 \u05d0\u05e9\u05e8 \u05d4\u05d5\u05d0 \u05e2\u05e6\u05de\u05d5 \u05e9\u05e8\u05d3 \u05d0\u05ea \u05d4\u05e9\u05d5\u05d0\u05d4, \u05d0\u05da \u05d0\u05e9\u05ea\u05d5 \u05d5\u05d9\u05dc\u05d3\u05d9\u05d5 \u05d4\u05e0\u05e8\u05d0\u05d9\u05dd \u05d1\u05e1\u05e8\u05d8 \u05e0\u05e1\u05e4\u05d5.\n\u05d4\u05e1\u05e8\u05d8 \u05e0\u05e2\u05e8\u05da \u05d5\u05d4\u05d5\u05e1\u05e3 \u05dc\u05d5 \u05e4\u05e1 \u05e7\u05d5\u05dc \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d1\u05d9\u05ea \u05d4\u05ea\u05e4\u05d5\u05e6\u05d5\u05ea \u05d1-2008\n\n\u05d4\u05e1\u05e8\u05d8  \u05e0\u05de\u05e1\u05e8 \u05dc\u05d1\u05d9\u05ea \u05d4\u05ea\u05e4\u05d5\u05e6\u05d5\u05ea \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d2\u05d1' \u05d7\u05d5\u05d5\u05d4 \u05db\u05d4\u05df, \u05d1\u05ea\u05d5 \u05d4\u05d7\u05d5\u05e8\u05d2\u05ea \u05e9\u05dc \u05d0\u05d3\u05d5\u05d0\u05e8\u05d3 \u05dc\u05e7\u05e1.", "En": "A film based on archival footage depicting a Jewish bourgeois family and friends from Brno, Czechoslovakia, enjoying themselves on vacation and in other leisure activities. The original footage was shot by Eduard Lax who documented his family and friends, an upper middle class family, spending leisure time together. The film was shot with a 8mm film camera by the father, Eduard Lax who survived the Holocaust while his wife and children that appear, perished. The original silent film was edited and a soundtrack was added by Beth Hatefutsoth in 2008\n\nThe film was presented to the museum, by Chava Cohen, stepdaughter of Eduard Lax."}, "Slug": {"He": "\u05d5\u05d9\u05d3\u05d0\u05d5_\u05d9\u05de\u05d9\u05dd-\u05d9\u05e4\u05d9\u05dd-\u05d1\u05d1\u05e8\u05e0\u05d5-\u05e6\u05db\u05d5\u05e1\u05dc\u05d5\u05d1\u05e7\u05d9\u05d4-1935-\u05e2\u05d1\u05e8\u05d9\u05ea", "En": "video_happy-days-in-brno-czechoslovakia-1929-hebrew"}, "video_url": "https://storage.googleapis.com/bhs-movies/9012ea49-6edf-4eb0-8609-f4dfaa86784d.mp4", "main_image_url": "https://storage.googleapis.com/bhs-flat-pics/2A399509-EFA8-4AB1-8847-6A07978F0386.jpg", "preview_image_url": "https://storage.googleapis.com/bhs-flat-pics/2A399509-EFA8-4AB1-8847-6A07978F0386.jpg", "image_urls": ["https://storage.googleapis.com/bhs-flat-pics/2A399509-EFA8-4AB1-8847-6A07978F0386.jpg"], "item_url_he": null, "item_url_en": null}, {"UnitType": 8, "UnitTypeDesc": "Personality", "Header": {"He": "\u05d1\u05d3\u05d9\u05e7\u05d45", "En": "TESTING5"}, "UnitText1": {"He": "\u05d1\u05e8\u05d5\u05d3, \u05de\u05e7\u05e1 (1884-1968) \n\n\u05e1\u05d5\u05e4\u05e8 \u05d5\u05de\u05dc\u05d7\u05d9\u05df.\u05e0\u05d5\u05dc\u05d3 \u05d1\u05e4\u05e8\u05d0\u05d2, \u05e6'\u05db\u05d5\u05e1\u05dc\u05d5\u05d1\u05e7\u05d9\u05d4. \u05dc\u05de\u05d3 \u05de\u05e9\u05e4\u05d8\u05d9\u05dd \u05d5\u05e7\u05d9\u05d1\u05dc \u05ea\u05d5\u05d0\u05e8 \u05de\u05d8\u05e2\u05dd \u05d4\u05d0\u05d5\u05e0\u05d9\u05d1\u05e8\u05e1\u05d9\u05d8\u05d4 \u05d4\u05d2\u05e8\u05de\u05e0\u05d9\u05ea \u05d1\u05e4\u05e8\u05d0\u05d2. \u05de-1910 \u05d4\u05d9\u05d4 \u05e4\u05e2\u05d9\u05dc \u05d1\u05ea\u05e0\u05d5\u05e2\u05d4 \u05d4\u05e6\u05d9\u05d5\u05e0\u05d9\u05ea, \u05d1-1918 \u05e0\u05de\u05e0\u05d4 \u05e2\u05dd \u05de\u05d9\u05d9\u05e1\u05d3\u05d9 \u05d4\u05de\u05d5\u05e2\u05e6\u05d4 \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05ea \u05e9\u05dc \u05d9\u05d4\u05d5\u05d3\u05d9 \u05e6'\u05db\u05d5\u05e1\u05dc\u05d5\u05d1\u05e7\u05d9\u05d4 \u05d5\u05db\u05d9\u05d4\u05df \u05db\u05e1\u05d2\u05df-\u05e0\u05e9\u05d9\u05d0\u05d4. \u05e2\u05d3 1924 \u05e2\u05d1\u05d3 \u05d1\u05e9\u05d1\u05d9\u05dc \u05de\u05de\u05e9\u05dc\u05ea \u05e6'\u05db\u05d5\u05e1\u05dc\u05d5\u05d1\u05e7\u05d9\u05d4. \n\n\u05d1\u05d4\u05d3\u05e8\u05d2\u05d4 \u05de\u05d9\u05e7\u05d3 \u05d0\u05ea \u05de\u05e2\u05d9\u05d9\u05e0\u05d9\u05d5 \u05d1\u05e1\u05e4\u05e8\u05d5\u05ea \u05d5\u05e9\u05d9\u05de\u05e9 \u05de\u05d1\u05e7\u05e8 \u05d4\u05de\u05d5\u05e1\u05d9\u05e7\u05d4 \u05d5\u05d4\u05ea\u05d9\u05d0\u05d8\u05e8\u05d5\u05df \u05e9\u05dc \u05d4\u05e2\u05d9\u05ea\u05d5\u05df \"\u05e4\u05e8\u05d0\u05d2\u05e8 \u05d8\u05d0\u05d2\u05d1\u05dc\u05d8\" (Prager\u00a0Tagblatt) \u05d1\u05e9\u05e0\u05d9\u05dd 1939-1924. \u05d1\u05d0\u05d5\u05ea\u05d5 \u05d6\u05de\u05df \u05d8\u05d9\u05e4\u05d7 \u05e7\u05e8\u05d9\u05d9\u05e8\u05d4 \u05db\u05e1\u05d5\u05e4\u05e8. \n\n\u05d1-1939 \u05e0\u05de\u05dc\u05d8 \u05d1\u05e8\u05d5\u05d3 \u05dc\u05d0\u05e8\u05e5-\u05d9\u05e9\u05e8\u05d0\u05dc \u05d5\u05d4\u05e9\u05ea\u05e7\u05e2 \u05d1\u05ea\u05dc-\u05d0\u05d1\u05d9\u05d1. \u05de\u05d0\u05d6 \u05e2\u05d3 \u05de\u05d5\u05ea\u05d5 \u05e4\u05e2\u05dc \u05db\u05d9\u05d5\u05e2\u05e5 \u05d0\u05de\u05e0\u05d5\u05ea\u05d9 \u05dc\u05ea\u05d9\u05d0\u05d8\u05e8\u05d5\u05df \u05d4\u05dc\u05d0\u05d5\u05de\u05d9 \"\u05d4\u05d1\u05d9\u05de\u05d4\" \u05d5\u05db\u05de\u05d1\u05e7\u05e8 \u05d4\u05de\u05d5\u05e1\u05d9\u05e7\u05d4 \u05e9\u05dc \"\u05d9\u05d3\u05d9\u05e2\u05d5\u05ea \u05d7\u05d3\u05e9\u05d5\u05ea\", \u05e2\u05d9\u05ea\u05d5\u05df \u05d9\u05d5\u05de\u05d9 \u05d1\u05e9\u05e4\u05d4 \u05d4\u05d2\u05e8\u05de\u05e0\u05d9\u05ea \u05e9\u05e8\u05d0\u05d4 \u05d0\u05d5\u05e8 \u05d1\u05ea\u05dc-\u05d0\u05d1\u05d9\u05d1.\n\n\u05d1\u05e8\u05d5\u05d3 \u05d4\u05d5\u05d0 \u05de\u05d7\u05d1\u05e8\u05dd \u05e9\u05dc \u05db\u05ea\u05d1\u05d9\u05dd \u05e8\u05d1\u05d9\u05dd \u05d5\u05d1\u05d9\u05e0\u05d9\u05d4\u05dd \"\u05d0\u05dc\u05d9\u05dc\u05d5\u05ea, \u05e0\u05e6\u05e8\u05d5\u05ea, \u05d9\u05d4\u05d3\u05d5\u05ea\" (1921); \u05e2\u05e9\u05e8\u05d9\u05dd \u05e8\u05d5\u05de\u05e0\u05d9\u05dd (\"\u05d4\u05d0\u05d9\u05e9\u05d4 \u05e9\u05de\u05ea\u05d0\u05d5\u05d5\u05d9\u05dd \u05d0\u05dc\u05d9\u05d4\", 1927, \"\u05d3\u05e8\u05db\u05d5 \u05e9\u05dc \u05d8\u05d9\u05db\u05d5 \u05d1\u05e8\u05d0\u05d4\u05d4 \u05d0\u05dc \u05d4\u05d0\u05dc\u05d4\u05d9\u05dd\", 1916); \u05de\u05d7\u05d6\u05d5\u05ea (\"\u05d4\u05de\u05dc\u05db\u05d4 \u05d0\u05e1\u05ea\u05e8\", 1918, \"\u05d4\u05de\u05d6\u05d9\u05d9\u05e4\u05d9\u05dd\", 1920); \u05d1\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea (\u05e4\u05e8\u05e0\u05e5 \u05e7\u05e4\u05e7\u05d0, \u05dc\u05d9\u05d0\u05d5\u05e9 \u05d9\u05d0\u05e0\u05d0\u05e6'\u05e7, 1924/25, \u05d0\u05d3\u05d5\u05dc\u05e3 \u05e9\u05e8\u05d9\u05d9\u05d1\u05e8 \u2013 \u05de\u05dc\u05d7\u05d9\u05df \u05d5\u05de\u05d5\u05e8\u05d4 \u05dc\u05e4\u05e1\u05e0\u05ea\u05e8 \u05e9\u05dc \u05d1\u05e8\u05d5\u05d3); \u05d5\u05d0\u05d5\u05d8\u05d5\u05d1\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d4 (1960). \n\n\u05e2\u05e8\u05da \u05d0\u05ea \u05db\u05ea\u05d1\u05d9\u05d5 \u05e9\u05dc \u05e7\u05e4\u05e7\u05d0 \u05d5\u05ea\u05e8\u05d2\u05dd \u05dc\u05d2\u05e8\u05de\u05e0\u05d9\u05ea \u05d0\u05ea \u05d4\u05dc\u05d9\u05d1\u05e8\u05d9\u05ea \u05e9\u05dc \u05d4\u05d0\u05d5\u05e4\u05e8\u05d5\u05ea \u05de\u05d0\u05ea \u05d9\u05d0\u05e0\u05d0\u05e6'\u05e7. \u05d9\u05e6\u05d9\u05e8\u05d5\u05ea\u05d9\u05d5 \u05d4\u05de\u05d5\u05e1\u05d9\u05e7\u05dc\u05d9\u05d5\u05ea \u05db\u05d5\u05dc\u05dc\u05d5\u05ea \u05d0\u05ea \u05d0\u05e4\u05d5\u05e8\u05d9\u05d6\u05de\u05d9\u05dd \u05dc\u05e4\u05e1\u05e0\u05ea\u05e8 (1938/39); \u05e8\u05e7\u05d5\u05d5\u05d9\u05d0\u05dd \u05e2\u05d1\u05e8\u05d9 \u05dc\u05d1\u05e8\u05d9\u05d8\u05d5\u05df \u05d5\u05dc\u05ea\u05d6\u05de\u05d5\u05e8\u05ea (1942); \u05e1\u05d5\u05d5\u05d9\u05d8\u05d4 \u05d9\u05dd-\u05ea\u05d9\u05db\u05d5\u05e0\u05d9\u05ea, \u05e8\u05e4\u05e1\u05d5\u05d3\u05d9\u05d4 \u05dc\u05e4\u05e1\u05e0\u05ea\u05e8; \u05e9\u05de\u05d5\u05e0\u05d4 \u05e9\u05d9\u05e8\u05d9\u05dd \u05dc\u05e7\u05d5\u05dc \u05d5\u05dc\u05e4\u05e1\u05e0\u05ea\u05e8; \u05de\u05d5\u05d5\u05ea \u05d5\u05d2\u05df-\u05e2\u05d3\u05df, \u05e9\u05e0\u05d9 \u05e9\u05d9\u05e8\u05d9\u05dd \u05dc\u05e7\u05d5\u05dc \u05d5\u05dc\u05e4\u05e1\u05e0\u05ea\u05e8 (1952). \u05e0\u05e4\u05d8\u05e8 \u05d1\u05ea\u05dc-\u05d0\u05d1\u05d9\u05d1.", "En": "Brod, Max (1884-1968)\n\nAuthor and composer. Born in Prague, Czechoslovakia, Brod studied law and graduated in 1907 from the German University in Prague. \n\nHe was active in the Zionist movement from 1910 onwards and in 1918 he co-founded the National Council of the Jews of Czechoslovakia and was elected its vice president. He worked for the Czech government until 1924. \n\nBrod gradually began to focus his interests on literature and served as the theatre and music critic for the Prager Tagblatt between 1924-1939. At the same time he began developing his writing career. \n\nIn 1939 Brod fled to Eretz Israel, where he settled in Tel Aviv. From the time of his immigration until his death, he served as the artistic adviser of Habimah National Theatre and as music critic for Yedioth Chadashoth, a German language daily published in Tel Aviv.\n\nBrod is author of many writings including the philosophical work Heidentum, Christentum, Judentum (1921), twenty novels (including Der Frau, nach der man sich sehnt, 1927, and Tycho Brahes Weg zu Gott, 1916), plays (including Die Koenigin Esther, 1918, Die Faelscher, 1920), biographies (including Franz Kafka, Leos Janacek, 1924-25, and the composer and Brod\u2019s own piano teacher, Adolph Schreiber) and an autobiography (1960). \n\nHe also arranged for publication of Kafka\u2019s writings. Brod translated the librettos of Janacek\u2019s operas into German. His musical compositions include APHORISMEN for piano (1938-39); REQUIEM HEBRAICUM for baritone and orchestra (1942), LA MEDITERRANEE, a rhapsody for piano, 8 LIEDER for voice and piano and TOD UND PARADIES, 2 songs for voice and piano (1952). He died in Tel Aviv."}, "Slug": {"He": "\u05d0\u05d9\u05e9\u05d9\u05d5\u05ea_\u05d1\u05e8\u05d5\u05d3-\u05de\u05e7\u05e1", "En": "luminary_brod-max"}, "video_url": null, "main_image_url": "https://storage.googleapis.com/bhs-flat-pics/D8BE8101-A275-434A-BEF3-7F88668DAC82.jpg", "preview_image_url": "https://storage.googleapis.com/bhs-flat-pics/D8BE8101-A275-434A-BEF3-7F88668DAC82.jpg", "image_urls": ["https://storage.googleapis.com/bhs-flat-pics/D8BE8101-A275-434A-BEF3-7F88668DAC82.jpg"], "item_url_he": null, "item_url_en": null}, {"UnitType": 8, "UnitTypeDesc": "Personality", "Header": {"He": "\u05d1\u05d3\u05d9\u05e7\u05d46", "En": "TESTING6"}, "UnitText1": {"He": "\u05de\u05d0\u05d4\u05dc\u05e8, \u05d2\u05d5\u05e1\u05d8\u05d1 (1860-1911) , \u05de\u05dc\u05d7\u05d9\u05df \u05d5\u05de\u05e0\u05e6\u05d7. \u05e0\u05d5\u05dc\u05d3 \u05d1\u05e7\u05d0\u05dc\u05d9\u05e9\u05d8 (Kalischt), \u05d1\u05d5\u05d4\u05de\u05d9\u05d4, (\u05d0\u05d6 \u05d1\u05d0\u05d9\u05de\u05e4\u05e8\u05d9\u05d4 \u05d4\u05d0\u05d5\u05e1\u05d8\u05e8\u05d5-\u05d4\u05d5\u05e0\u05d2\u05e8\u05d9\u05ea). \u05d1-1875 \u05e0\u05e9\u05dc\u05d7 \u05dc\u05d5\u05d5\u05d9\u05e0\u05d4 \u05dc\u05dc\u05de\u05d5\u05d3 \u05de\u05d5\u05e1\u05d9\u05e7\u05d4 \u05d1\u05e7\u05d5\u05e0\u05e1\u05e8\u05d1\u05d8\u05d5\u05e8\u05d9\u05d5\u05df \u05d5\u05d0\u05e6\u05dc \u05d0\u05e0\u05d8\u05d5\u05df \u05d1\u05e8\u05d5\u05e7\u05e0\u05e8. \u05de-1880 \u05d4\u05ea\u05d7\u05d9\u05dc \u05dc\u05d4\u05ea\u05e4\u05e8\u05e1\u05dd \u05db\u05de\u05e0\u05e6\u05d7, \u05dc\u05d0\u05d7\u05e8 \u05e9\u05e4\u05e2\u05dc \u05d1\u05e7\u05d0\u05e1\u05dc (1883), \u05e4\u05e8\u05d0\u05d2, \u05dc\u05d9\u05d9\u05e4\u05e6\u05d9\u05d2 (\u05de\u05e0\u05e6\u05d7 \u05de\u05e9\u05e0\u05d4 \u05dc\u05d0\u05e8\u05ea\u05d5\u05e8 \u05e0\u05d9\u05e7\u05d9\u05e9), \u05d1\u05d5\u05d3\u05e4\u05e9\u05d8 (1888) \u05d5\u05d4\u05de\u05d1\u05d5\u05e8\u05d2 (1891), \u05d1-1897 \u05d4\u05ea\u05de\u05e0\u05d4 \u05dc\u05de\u05e0\u05d4\u05dc \u05d4\u05d0\u05d5\u05e4\u05e8\u05d4 \u05d4\u05de\u05dc\u05db\u05d5\u05ea\u05d9\u05ea \u05e9\u05dc \u05d5\u05d9\u05e0\u05d4. \u05db\u05d3\u05d9 \u05dc\u05d4\u05d1\u05d8\u05d9\u05d7 \u05d0\u05ea \u05de\u05e7\u05d5\u05de\u05d5, \u05e0\u05d0\u05dc\u05e5 \u05dc\u05d4\u05ea\u05e0\u05e6\u05e8 \u05d5\u05dc\u05d0\u05de\u05e5 \u05d0\u05ea \u05d4\u05d3\u05ea \u05d4\u05e7\u05ea\u05d5\u05dc\u05d9\u05ea. \u05d1\u05e9\u05e0\u05d9\u05dd 1901-1898 \u05e0\u05d9\u05d4\u05dc \u05d2\u05dd \u05d0\u05ea \u05d4\u05ea\u05d6\u05de\u05d5\u05e8\u05ea \u05d4\u05e4\u05d9\u05dc\u05d4\u05e8\u05de\u05d5\u05e0\u05d9\u05ea \u05e9\u05dc \u05d5\u05d9\u05e0\u05d4. \u05ea\u05e7\u05d5\u05e4\u05ea \u05e2\u05d1\u05d5\u05d3\u05ea\u05d5 \u05d1\u05d5\u05d5\u05d9\u05e0\u05d4 \u05d4\u05d1\u05d9\u05d0\u05d4 \u05d0\u05ea \u05d4\u05d0\u05d5\u05e4\u05e8\u05d4 \u05dc\u05d4\u05d9\u05e9\u05d2\u05d9\u05dd \u05d0\u05de\u05e0\u05d5\u05ea\u05d9\u05d9\u05dd \u05d7\u05e1\u05e8\u05d9 \u05ea\u05e7\u05d3\u05d9\u05dd. \u05d1\u05de\u05e8\u05db\u05d6 \u05d4\u05e8\u05e4\u05e8\u05d8\u05d5\u05d0\u05e8 \u05e9\u05dc\u05d5 \u05d4\u05d9\u05d5 \u05d4\u05d0\u05d5\u05e4\u05e8\u05d5\u05ea \u05e9\u05dc \u05de\u05d5\u05e6\u05e8\u05d8 \u05d5\u05d5\u05d0\u05d2\u05e0\u05e8. \u05d1-1907 \u05d4\u05ea\u05e4\u05d8\u05e8 \u05de\u05d0\u05d4\u05dc\u05e8 \u05e2\u05e7\u05d1 \u05ea\u05db\u05db\u05d9\u05dd \u05d5\u05d4\u05d9\u05d4 \u05de\u05e0\u05e6\u05d7 \u05d0\u05d5\u05e8\u05d7 \u05d1\u05de\u05d8\u05e8\u05d5\u05e4\u05d5\u05dc\u05d9\u05d8\u05df \u05d0\u05d5\u05e4\u05e8\u05d4 \u05d5\u05d1\u05ea\u05d6\u05de\u05d5\u05e8\u05ea \u05d4\u05e4\u05d9\u05dc\u05d4\u05e8\u05de\u05d5\u05e0\u05d9\u05ea \u05e9\u05dc \u05e0\u05d9\u05d5-\u05d9\u05d5\u05e8\u05e7. \u05d1-1909 \u05de\u05d5\u05e0\u05d4 \u05dc\u05de\u05e0\u05d4\u05dc \u05d4\u05d0\u05d2\u05d5\u05d3\u05d4 \u05d4\u05e4\u05d9\u05dc\u05d4\u05e8\u05de\u05d5\u05e0\u05d9\u05ea. \u05de\u05d0\u05d4\u05dc\u05e8 \u05e0\u05d9\u05e1\u05d4 \u05dc\u05d4\u05e9\u05ea\u05d7\u05e8\u05e8 \u05de\u05d3\u05e8\u05da \u05d4\u05d1\u05d9\u05e6\u05d5\u05e2 \u05d4\u05de\u05e1\u05d5\u05e8\u05ea\u05d9\u05ea \u05d5\u05dc\u05d9\u05d9\u05d7\u05d3 \u05d0\u05ea \u05de\u05d0\u05de\u05e6\u05d9\u05d5 \u05dc\u05d4\u05d1\u05d4\u05e8\u05ea \u05de\u05d4\u05d5\u05ea \u05d4\u05d9\u05e6\u05d9\u05e8\u05d4 \u05d5\u05ea\u05db\u05e0\u05d4. \u05dc\u05e2\u05ea\u05d9\u05dd \u05e7\u05e8\u05d5\u05d1\u05d5\u05ea, \u05e2\u05e8\u05da \u05ea\u05d9\u05e7\u05d5\u05e0\u05d9\u05dd \u05d1\u05d9\u05e6\u05d9\u05e8\u05d5\u05ea \u05e9\u05e2\u05dc\u05d9\u05d4\u05df \u05e0\u05d9\u05e6\u05d7.\n\u05d1\u05de\u05e9\u05da \u05d4\u05e9\u05e0\u05d9\u05dd \u05d0\u05d9\u05de\u05e5 \u05dc\u05e2\u05e6\u05de\u05d5 \u05ea\u05db\u05e0\u05d9\u05ea \u05e2\u05d1\u05d5\u05d3\u05d4: \u05d4\u05d5\u05d0 \u05e0\u05d4\u05d2 \u05dc\u05d4\u05dc\u05d7\u05d9\u05df \u05d1\u05d7\u05d5\u05e4\u05e9\u05d5\u05ea \u05d4\u05e7\u05d9\u05e5 \u05d5\u05dc\u05e2\u05e8\u05d5\u05da \u05d7\u05d6\u05e8\u05d5\u05ea \u05d1\u05e1\u05ea\u05d9\u05d5. \u05d0\u05e3 \u05db\u05d9 \u05e2\u05d1\u05d5\u05d3\u05ea\u05d5 \u05d4\u05e2\u05d9\u05e7\u05e8\u05d9\u05ea \u05d4\u05d9\u05d9\u05ea\u05d4 \u05e0\u05d9\u05e6\u05d5\u05d7 \u05e2\u05dc \u05d0\u05d5\u05e4\u05e8\u05d5\u05ea, \u05d4\u05d5\u05d0 \u05d4\u05dc\u05d7\u05d9\u05df \u05e1\u05d9\u05de\u05e4\u05d5\u05e0\u05d9\u05d5\u05ea \u05d5\u05e9\u05d9\u05e8\u05d9\u05dd. \u05de\u05db\u05dc\u05d5\u05dc \u05d9\u05e6\u05d9\u05e8\u05d5\u05ea\u05d9\u05d5 \u05db\u05d5\u05dc\u05dc \u05ea\u05e9\u05e2 \u05e1\u05d9\u05de\u05e4\u05d5\u05e0\u05d9\u05d5\u05ea \u05d5\u05d8\u05d9\u05d5\u05d8\u05d4 \u05dc\u05e1\u05d9\u05de\u05e4\u05d5\u05e0\u05d9\u05d4 \u05e2\u05e9\u05d9\u05e8\u05d9\u05ea. \u05d4\u05dc\u05d7\u05d9\u05df \u05e9\u05d9\u05e8\u05d9\u05dd \u05d5\u05de\u05d7\u05d6\u05d5\u05e8\u05d9 \u05e9\u05d9\u05e8\u05d9\u05dd \u05dc\u05e7\u05d5\u05dc \u05d5\u05dc\u05e4\u05e1\u05e0\u05ea\u05e8 \u05dc\u05d8\u05e7\u05e1\u05d8\u05d9\u05dd \u05de\u05df \u05d4\u05e1\u05e4\u05e8\u05d5\u05ea \u05d4\u05d2\u05e8\u05de\u05e0\u05d9\u05ea \u05e9\u05dc \u05d9\u05de\u05d9 \u05d4\u05d1\u05d9\u05e0\u05d9\u05d9\u05dd \u05d5\u05de\u05df \u05d4\u05e1\u05e4\u05e8\u05d5\u05ea \u05d1\u05ea \u05d6\u05de\u05e0\u05d5. \u05d1\u05d9\u05df \u05d9\u05e6\u05d9\u05e8\u05d5\u05ea\u05d9\u05d5 \u05e9\u05d9\u05e8\u05d9 \u05e9\u05d5\u05dc\u05d9\u05d9\u05d4 \u05e0\u05d5\u05d3\u05d3 (1885-1883) \u05d5\u05e9\u05d9\u05e8\u05d9 \u05de\u05d5\u05ea \u05d9\u05dc\u05d3\u05d9\u05dd (1904-1901). \u05d4\"\u05e1\u05d9\u05de\u05e4\u05d5\u05e0\u05d9\u05d4 \u05d1\u05e9\u05d9\u05e8\u05d9\u05dd\" \u05e9\u05dc\u05d5, \u05d4\u05e9\u05d9\u05e8 \u05e2\u05dc \u05d4\u05d0\u05e8\u05e5 (1907/08), \u05de\u05d1\u05d5\u05e1\u05e1\u05ea \u05e2\u05dc \u05e9\u05d9\u05e9\u05d4 \u05e9\u05d9\u05e8\u05d9\u05dd \u05de\u05ea\u05d5\u05da \u05d4\u05e7\u05d5\u05d1\u05e5 \"\u05d7\u05dc\u05d9\u05dc \u05e1\u05d9\u05e0\u05d9\" \u05de\u05d0\u05ea \u05d4\u05e0\u05e1 \u05d1\u05d8\u05d2\u05d4 (Hans\u00a0Bethge), \u05d5\u05e0\u05db\u05ea\u05d1\u05d4 \u05dc\u05e7\u05d5\u05dc \u05d5\u05dc\u05ea\u05d6\u05de\u05d5\u05e8\u05ea \u05d2\u05d3\u05d5\u05dc\u05d4. \u05e0\u05e4\u05d8\u05e8 \u05d1\u05d5\u05d5\u05d9\u05e0\u05d4, \u05d0\u05d5\u05e1\u05d8\u05e8\u05d9\u05d4.", "En": "Mahler, Gustav (1860-1911) , composer and conductor. Born in Kalischt, Bohemia, (the former Austro-Hungarian Empire) in 1875 he was sent to study music in Vienna at the Conservatory and with Anton Bruckner. From 1880 he rose through positions in Kassel (1883), Prague, Leipzig (second to Arthur Nikisch), Budapest (1888) and Hamburg (1891) to become director of the Vienna Court Opera in 1897. In order to secure this position Mahler had to convert to Catholicism. Between 1898-1901 he also directed the Vienna Philharmonic Orchestra. His tenure in Vienna brought the opera to artistic achievements previously unknown. At the core of the repertoire he put Mozart\u2019s and Wagner\u2019s operas. Mahler resigned in 1907 because of serious intrigues. He became guest conductor at the Metropolitan Opera and the New York Philharmonic Orchestra. In 1909 he was appointed director of the Philharmonic Society. Mahler tried to free himself from traditional performances and devote himself to the precise clarification of the works' sense and content. He often undertook corrections of the scores he conducted.\nThroughout the years Mahler adopted a work pattern: composing during summer vacations and rehearsing his compositions in the autumn. Even though his major occupation was conducting operas, he was a composer devoted to symphony and Lied. He composed 9 symphonies and left a draft of the tenth. He wrote songs and song cycles for voice and piano from German medieval and contemporary literature, among them LIEDER EINES FAHRENDEN GESELLEN (1883-1885) and KINDERTOTENLIEDER (1901-1904, both cycles for voice and orchestra). His \u201csymphony in songs\u201d DAS LIED VON DER ERDE (1907/08) is based on six songs from Chinese Flute by Hans Bethge, written for voice and large orchestra. He died in Vienna."}, "Slug": {"He": "\u05d0\u05d9\u05e9\u05d9\u05d5\u05ea_\u05de\u05d0\u05d4\u05dc\u05e8-\u05d2\u05d5\u05e1\u05d8\u05d1", "En": "luminary_mahler-gustav"}, "video_url": null, "main_image_url": "https://storage.googleapis.com/bhs-flat-pics/D817EEE0-F8C8-4971-8864-379720C386D9.jpg", "preview_image_url": "https://storage.googleapis.com/bhs-flat-pics/D817EEE0-F8C8-4971-8864-379720C386D9.jpg", "image_urls": ["https://storage.googleapis.com/bhs-flat-pics/BEA6A1B7-547B-4E3A-9D54-0BBE9872A90C.jpg", "https://storage.googleapis.com/bhs-flat-pics/D817EEE0-F8C8-4971-8864-379720C386D9.jpg", "https://storage.googleapis.com/bhs-flat-pics/42BAC735-037F-49AD-833C-6C878A4C8893.jpg", "https://storage.googleapis.com/bhs-flat-pics/E6036C77-4B80-4F5C-B696-89F686C9CACF.jpg", "https://storage.googleapis.com/bhs-flat-pics/1C667BF5-2B83-44BD-9640-FA4955A2F614.jpg"], "item_url_he": null, "item_url_en": null}, {"UnitType": 8, "UnitTypeDesc": "Personality", "Header": {"He": "\u05d1\u05d3\u05d9\u05e7\u05d47", "En": "TESTING7"}, "UnitText1": {"He": "\u05e7\u05e4\u05e7\u05d0, \u05e4\u05e8\u05e0\u05e5 (1883-1924), \u05e1\u05d5\u05e4\u05e8 \u05e9\u05e0\u05d5\u05dc\u05d3 \u05dc\u05de\u05e9\u05e4\u05d7\u05d4 \u05d9\u05d4\u05d5\u05d3\u05d9\u05ea \u05de\u05de\u05e2\u05de\u05d3 \u05d1\u05d9\u05e0\u05d5\u05e0\u05d9 \u05d1\u05e4\u05e8\u05d0\u05d2, \u05d1\u05d5\u05d4\u05de\u05d9\u05d4 (\u05d0\u05d6 \u05d7\u05dc\u05e7 \u05de\u05d4\u05d0\u05d9\u05de\u05e4\u05e8\u05d9\u05d4 \u05d4\u05d0\u05d5\u05e1\u05d8\u05e8\u05d5 \u05d4\u05d5\u05e0\u05d2\u05e8\u05d9\u05d4, \u05db\u05d9\u05d5\u05dd \u05d1\u05e6'\u05db\u05d9\u05d4). \u05e7\u05e4\u05e7\u05d0 \u05d4\u05d9\u05d4 \u05d9\u05dc\u05d3 \u05d1\u05d5\u05d3\u05d3. \u05d4\u05d5\u05d0 \u05dc\u05de\u05d3 \u05d1\u05d1\u05d9\u05ea \u05e1\u05e4\u05e8 \u05ea\u05d9\u05db\u05d5\u05df \u05d1\u05d2\u05e8\u05de\u05e0\u05d9\u05d4 \u05d5\u05dc\u05d0\u05d7\u05e8 \u05de\u05db\u05df \u05d1\u05d0\u05d5\u05e0\u05d9\u05d1\u05e8\u05e1\u05d9\u05d8\u05d4 \u05dc\u05e7\u05e8\u05d0\u05ea \u05d3\u05d5\u05e7\u05d8\u05d5\u05e8\u05d8 \u05d1\u05de\u05e9\u05e4\u05d8\u05d9\u05dd. \u05d4\u05d5\u05d0 \u05de\u05e6\u05d0 \u05e2\u05d1\u05d5\u05d3\u05d4 \u05d1\u05d7\u05d1\u05e8\u05d5\u05ea \u05d1\u05d9\u05d8\u05d5\u05d7, \u05d1\u05d4 \u05d4\u05d5\u05d0 \u05e2\u05d1\u05d3 \u05e9\u05e2\u05d5\u05ea \u05d0\u05e8\u05d5\u05db\u05d5\u05ea \u05d5\u05d1\u05e1\u05d5\u05e4\u05d5 \u05e9\u05dc \u05d4\u05d3\u05d1\u05e8 \u05e0\u05d0\u05dc\u05e5 \u05dc\u05d4\u05ea\u05e4\u05d8\u05e8 \u05d1\u05e9\u05dc \u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05dc\u05e7\u05d5\u05d9\u05d4. \u05de-1917 \u05d4\u05d5\u05d0 \u05e1\u05d1\u05dc \u05de\u05de\u05d7\u05dc\u05ea \u05d4\u05e9\u05d7\u05e4\u05ea \u05d5\u05d7\u05dc\u05e7 \u05d4\u05d2\u05d3\u05d5\u05dc \u05de\u05d7\u05d9\u05d9\u05d5 \u05de\u05db\u05d0\u05df \u05d5\u05d0\u05d9\u05dc\u05da \u05d1\u05d9\u05dc\u05d4 \u05d1\u05d1\u05ea\u05d9 \u05d4\u05de\u05e8\u05d2\u05d5\u05e2. \n\u05e8\u05e7 \u05db\u05de\u05d4 \u05de\u05d9\u05e6\u05d9\u05e8\u05d5\u05ea\u05d9\u05d5 \u2013 \u05d5\u05dc\u05d0\u05d5 \u05d3\u05d5\u05d5\u05e7\u05d0 \u05d4\u05de\u05d5\u05d1\u05d7\u05e8\u05d5\u05ea \u05e9\u05d1\u05d4\u05df - \u05d9\u05e6\u05d0\u05d5 \u05dc\u05d0\u05d5\u05e8 \u05d1\u05de\u05d4\u05dc\u05da \u05d7\u05d9\u05d9\u05d5. \u05d1\u05e0\u05d5\u05d2\u05e2 \u05dc\u05e9\u05d0\u05e8 \u05d4\u05d9\u05e6\u05d9\u05e8\u05d5\u05ea, \u05e7\u05e4\u05e7\u05d0 \u05d4\u05e9\u05d0\u05d9\u05e8 \u05d4\u05d5\u05e8\u05d0\u05d5\u05ea \u05dc\u05d7\u05d1\u05e8 \u05e9\u05dc\u05d5 \u05d5\u05de\u05e0\u05d4\u05dc \u05e2\u05d6\u05d1\u05d5\u05e0\u05d5 \u05d4\u05e1\u05e4\u05e8\u05d5\u05ea\u05d9, \u05de\u05e7\u05e1 \u05d1\u05e8\u05d5\u05d3, \u05dc\u05e9\u05e8\u05d5\u05e3 \u05d0\u05d5\u05ea\u05df. \n\u05d1\u05e8\u05d5\u05d3 \u05dc\u05d0 \u05e6\u05d9\u05d9\u05ea \u05dc\u05d1\u05e7\u05e9\u05ea\u05d5 \u05e9\u05dc \u05e7\u05e4\u05e7\u05d0 \u05d5\u05e4\u05e8\u05e1\u05d5\u05dd \u05d4\u05e8\u05d5\u05de\u05e0\u05d9\u05dd \u05d4\u05d1\u05d9\u05d0 \u05dc\u05e7\u05e4\u05e7\u05d0 \u05ea\u05d4\u05d9\u05dc\u05ea \u05e2\u05d5\u05dc\u05dd \u05dc\u05d0\u05d7\u05e8 \u05de\u05d5\u05ea\u05d5. \u05d4\u05d9\u05d3\u05d5\u05e2\u05d9\u05dd \u05de\u05d1\u05d9\u05df \u05d4\u05e8\u05d5\u05de\u05e0\u05d9\u05dd \u05e9\u05dc\u05d5 \u05d4\u05dd: \"\u05d4\u05de\u05e9\u05e4\u05d8\", \"\u05d4\u05d8\u05d9\u05e8\u05d4\", \u05d5- \"\u05d0\u05de\u05e8\u05d9\u05e7\u05d4\", \u05e9\u05d0\u05ea \u05db\u05d5\u05dc\u05dd \u05db\u05ea\u05d1 \u05d1\u05d2\u05e8\u05de\u05e0\u05d9\u05ea. \u05e2\u05d3 \u05d4\u05d9\u05d5\u05dd \u05db\u05e9\u05de\u05ea\u05d0\u05e8\u05d9\u05dd \u05de\u05e9\u05d4\u05d5 \u05db-\"\u05e7\u05e4\u05e7\u05d0\u05d9\" \u05d4\u05db\u05d5\u05d5\u05e0\u05d4 \u05d4\u05d9\u05d0 \u05dc\u05d4\u05e9\u05e4\u05e2\u05ea \u05e2\u05d5\u05dc\u05de\u05d5 \u05d4\u05e1\u05e4\u05e8\u05d5\u05ea\u05d9 \u05e9\u05dc \u05e7\u05e4\u05e7\u05d0 \u05e9\u05d4\u05db\u05d9\u05dc \u05d0\u05dc\u05de\u05e0\u05d8\u05d9\u05dd \u05e9\u05dc \u05ea\u05e1\u05db\u05d5\u05dc, \u05d7\u05d5\u05e1\u05e8 \u05ea\u05e7\u05d5\u05d5\u05d4 \u05d5\u05e1\u05d9\u05d5\u05d8 \u05e7\u05d9\u05d5\u05de\u05d9. \n\u05e7\u05e4\u05e7\u05d0 \u05e0\u05d8\u05de\u05df \u05d1\u05e7\u05d1\u05e8 \u05d4\u05de\u05e9\u05e4\u05d7\u05d4 \u05d1\u05e4\u05e8\u05d0\u05d2.", "En": "Kafka, Franz (1883-1924), author, born to a middle class family in Prague, Bohemia (then part of Austria-Hungary, now in the Czech Republic)\n\nKafka was a lonely child. He studied at a German high school and then at university, becoming a doctor of law. He found positions in insurance companies, where he worked long hours and eventually had to resign owing to poor health. \n\nFrom 1917 he suffered from tuberculosis and much of his life from then on was spent in Sanatoriums. He was buried in the family tomb in Prague. \n\nOnly a few of his works - and not his best known - were published during his lifetime and he left instructions to his friend and literary executor, Max Brod, to burn the remainder. \n\nBrod disobeyed and the publication of his novels brought Kafka posthumous world fame. Best-known are his novels, \"The Trial\", \"The Castle\", and \"America\", all written in German. Their world of frustration and nightmarish hopelessness brought the word 'Kafkaesque' into the language."}, "Slug": {"He": "\u05d0\u05d9\u05e9\u05d9\u05d5\u05ea_\u05e7\u05e4\u05e7\u05d0-\u05e4\u05e8\u05e0\u05e5", "En": "luminary_kafka-franz"}, "video_url": null, "main_image_url": "https://storage.googleapis.com/bhs-flat-pics/36D08C4D-5777-42AB-9B14-B3C67DF918E9.jpg", "preview_image_url": "https://storage.googleapis.com/bhs-flat-pics/36D08C4D-5777-42AB-9B14-B3C67DF918E9.jpg", "image_urls": ["https://storage.googleapis.com/bhs-flat-pics/AAB05A99-CA2F-43AB-A89B-52F120383D68.jpg", "https://storage.googleapis.com/bhs-flat-pics/684551E3-48E6-490F-9CF6-66020C417DC5.jpg", "https://storage.googleapis.com/bhs-flat-pics/36D08C4D-5777-42AB-9B14-B3C67DF918E9.jpg"], "item_ur